	{id: 1, name: 'Керим'},
	{id: 2, name: 'Ильяс'},
	{id: 3, name: 'Ибраим'},
	{id: 4, name: 'Ахмад'},
	{id: 5, name: 'Аким'},
]

let messagesData = [
	{id: 1, message: 'Hello, how are you?'},
	{id: 2, message: 'Hi, i`m good'},
]

// let dialogsElements = dialogsData.map( d => <App name={d.name} dialogId={d.id}/>) 
